(function () {
    try {
        var result = SyncEventRecord.sync(current);

        if (result.success === true) {
            activity.result = 'ok';
        } else if (result.canRetry === true) {
            activity.result = 'retry';
            activity.fault_description = result.message;
        } else {
            setError(result.message);
        }
    } catch (e) {
        setError("Unexpected workflow error:" + e);
    }

    function setError(error) {
        var ident = context.name + "." + activity.name;
        workflow.error("[" + ident + "] " + error);
        activity.result = 'error';
        activity.fault_description = error;
    }
})();

